"95839":{"id":"95839","name":"LOVE: A História de Lisey","slug":"love-a-historia-de-lisey","original_title":"Lisey's Story","overview":"Baseada no livro de Stephen King, esta série aterrorizante conta a história da viúva Lisey Landon e os eventos perturbadores que reacendem suas memórias do seu casamento com o escritor Scott Landon e as trevas que o atormentavam.","first_air_date":"2021-06-04","episode_run_time":50,"vote_average":5.9,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Stephen King"],"production_companies":["Warner Bros. Television","Bad Robot","fortysixty"],"genres":["Mistério","Drama","Sci-Fi & Fantasy"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/wl0DQUT90o3e9gXHEeB5iyK05jb.jpg","poster_path":"https://image.tmdb.org/t/p/original/3wh5Dwggf0EQOBgxPUvXcCdMtpZ.jpg","cast":["Julianne Moore","Clive Owen","Jennifer Jason Leigh","Dane DeHaan","Joan Allen"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/3wh5Dwggf0EQOBgxPUvXcCdMtpZ.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/3wh5Dwggf0EQOBgxPUvXcCdMtpZ.jpg","air_date":"2021-06-04","episode_count":8,"overview":"N/A","vote_average":6.7,"episodes":{"1":{"name":"Caça ao Bool","overview":"Lisey Landon começa a enfrentar realidades reprimidas sobre seu falecido marido, o romancista Scott Landon, dois anos após sua morte.","air_date":"2021-06-04","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/wG36QB2vjyipxTgpUh9xo3f0Rrn.jpg","vote_average":6},"2":{"name":"Bool de sangue","overview":"Lisey liga para o professor Dashmiel para avisá-lo sobre Jim Dooley, que já está por perto.","air_date":"2021-06-04","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/fIi5hAMCslXYg2ZeqSRuQloGhHY.jpg","vote_average":6.3},"3":{"name":"Debaixo da árvore Nhami-Nhami","overview":"A caça ao bool leva Lisey a um momento de seu passado, quando Scott compartilhou uma confissão sobre sua família e infância traumática.","air_date":"2021-06-11","runtime":53,"still_path":"https://image.tmdb.org/t/p/original/Zs8mt4KlfbxK2ZqyeBh3grS2UJ.jpg","vote_average":6.5},"4":{"name":"Jim Dandy","overview":"Depois de uma experiência terrível, Lisey abre os portões de sua memória para encontrar respostas no mundo de Boo'ya Moon de Scott.","air_date":"2021-06-18","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/3NKGHs1ZD1KHdpCbAISK0hsuUTa.jpg","vote_average":7},"5":{"name":"O bom irmão","overview":"Scott leva Lisey de volta ao momento em que ela aprendeu sobre Boo'ya Moon e revela a terrível verdade sobre o passado de sua família.","air_date":"2021-06-25","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/1cJfJ5r1aFIH63SQlJHyHvtU5kZ.jpg","vote_average":6.5},"6":{"name":"Agora você deve ficar quieto","overview":"Com a ajuda de Darla, Lisey sai para resgatar Amanda para que as três irmãs possam se unir para enfrentar Jim Dooley.","air_date":"2021-07-02","runtime":47,"still_path":"https://image.tmdb.org/t/p/original/AtKJQ050qD8ylYphtru5Sba5xZ.jpg","vote_average":6},"7":{"name":"Sem luz, sem faísca","overview":"Dois anos após a morte de Scott, Lisey deve enfrentar o óbito novamente. Mas desta vez, ela tem um plano - e envolve Boo'ya Moon.","air_date":"2021-07-09","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/t9f1M6DK7vanEOPmfdWKJoR3LGE.jpg","vote_average":8},"8":{"name":"A história de Lisey","overview":"Final da série. Lisey enfrenta Dooley e descobre o último presente de Scott para ela.","air_date":"2021-07-16","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/16BzHgpUdwJ1HCPiKyySHGI9Gid.jpg","vote_average":7}}}}},
