"118477":{"id":"118477","name":"OceanXplorers","slug":"oceanxplorers","original_title":"OceanXplorers","overview":"Acompanha as missões do OceanXplorer, o navio de pesquisa científica e exploração de última geração da OceanX. A embarcação investiga as fronteiras mais distantes dos oceanos do mundo, 80% das quais são totalmente desconhecidas.","first_air_date":"2024-08-18","episode_run_time":0,"vote_average":7.9,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Brian Catalina"],"production_companies":["BBC Studios Natural History Unit","OceanX Media","Brian Catalina Entertainment","National Geographic","Earthship Productions"],"genres":["Documentário"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/xpKNATxA5o6q3JBxhlvBqhiDsV1.jpg","poster_path":"https://image.tmdb.org/t/p/original/ftrhUtFMrNI0MlJOs3XEe3rmWA3.jpg","cast":["Asha de Vos","Zoleka Filander","Eric Stackpole","Aldo Kane","James Cameron"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/ftrhUtFMrNI0MlJOs3XEe3rmWA3.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/ftrhUtFMrNI0MlJOs3XEe3rmWA3.jpg","air_date":"2024-08-18","episode_count":6,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"O Reino das Jubartes","overview":"A equipe viaja para a República Dominicana, no Caribe, para revelar os maiores segredos da vida da baleia jubarte do Atlântico Norte. Eles testemunham uma mãe defendendo seu filhote na derradeira batalha oceânica com um bando de orcas.","air_date":"2024-08-18","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/66GAowsDtz6ULj6reSU2nb6yGeP.jpg","vote_average":0},"2":{"name":"Gigantes das Profundezas","overview":"Nos Açores, a equipe segue os esquivos cachalotes até seus locais de caça a uma milha abaixo da superfície, onde descobrem as vidas secretas dessas baleias que mergulham profundamente.","air_date":"2024-08-18","runtime":38,"still_path":"https://image.tmdb.org/t/p/original/6V95TKYSU5FmzULKaJv2P4OEIVY.jpg","vote_average":0},"3":{"name":"Tubarão Jurássico","overview":"Ainda nos Açores, a equipe rastreia o tubarão-anequim para aprender mais sobre seus padrões noturnos de caça no abismo. A equipe marca e recupera dados valiosos sobre o tubarão, descobrindo o motivo de sua jornada épica as profundezas à noite.","air_date":"2024-08-18","runtime":37,"still_path":"https://image.tmdb.org/t/p/original/2vrT4kZzS66tKnltTK2Yd6XxMwo.jpg","vote_average":0},"4":{"name":"A Rota do Tubarão-Martelo","overview":"A equipe está nas águas cristalinas de Bimini, nas Bahamas, para testemunhar a incrível jornada dos grandes tubarões-martelo. A equipe acompanha a migração deles de volta a essas águas quentes no inverno.","air_date":"2024-08-18","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/a2Z1uKH035cQX4DfLnYvumlYEez.jpg","vote_average":0},"5":{"name":"O Reino do Urso Polar","overview":"A equipe leva o OceanXplorer para Svalbard, na Noruega. O mundo gelado do Ártico está mudando mais rápido do que em qualquer outro lugar da Terra. A missão da equipe é descobrir se os ursos polares de Svalbard estão se adaptando àquele ambiente.","air_date":"2024-08-18","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/urJ8vQzkHJNJ0RjSwVx7sJlObQW.jpg","vote_average":0},"6":{"name":"Gigantes do Gelo","overview":"A equipe leva o OceanXplorer para o ponto mais ao norte que pode, até a borda da calota de gelo do Ártico. Os especialistas aprendem como uma população de baleias-da-Groenlândia, que um dia foi caçada quase até a extinção, está se saindo hoje.","air_date":"2024-08-18","runtime":41,"still_path":"https://image.tmdb.org/t/p/original/61NprmjifJlQ6yJiLY0rYACcve9.jpg","vote_average":0}}}}},
