"123378":{"id":"123378","name":"Sentença","slug":"sentenca","original_title":"Sentença","overview":"Heloísa é uma advogada criminalista que acredita na lei e no direito à defesa, mas se vê numa encruzilhada quando a justiça falha com quem mais ama.","first_air_date":"2022-04-15","episode_run_time":45,"vote_average":6,"number_of_seasons":1,"number_of_episodes":6,"created_by":["Paula Knudsen"],"production_companies":["Cimarrón Cine"],"genres":["Drama","Crime"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/h8Env8iYWHXDZ8R4fypu9JvERsF.jpg","poster_path":"https://image.tmdb.org/t/p/original/uGozGq4skp2bYfNeJWscx8bHIw2.jpg","cast":["Camila Morgado","Fernando Alves Pinto","Victor Hugo Martins","Lena Roque","Lucinha Lins"],"trailer":"oLtCvrqtipw","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/uGozGq4skp2bYfNeJWscx8bHIw2.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/uGozGq4skp2bYfNeJWscx8bHIw2.jpg","air_date":"2022-04-15","episode_count":6,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"Então, Dotôra...","overview":"O vídeo de um crime bárbaro viraliza nas redes sociais por todo o país e Heloísa precisa assumir o caso enquanto tenta equilibrar a vida de advogada criminalista com os problemas cotidianos de seu filho adotivo e seu marido promotor.","air_date":"2022-04-15","runtime":45,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":10},"2":{"name":"Nada Engana Mais Que Aparências","overview":"Atormentada pelo dilema imposto por Zeca, as memórias do crime de sua infância se tornam cada vez mais frequentes na cabeça de Heloísa. Com o tempo se esgotando pela piora de Carolina, ela precisa tomar uma decisão urgente, o que pode lhe custar muito mais caro do que Heloísa imagina.","air_date":"2022-04-15","runtime":43,"still_path":"https://image.tmdb.org/t/p/original/5YS88rjfAv1rdbC63YwJrcmFdNg.jpg","vote_average":0},"3":{"name":"Eu Não Escolhi Esquecer","overview":"Heloísa não consegue esquecer que a cirurgia de Carolina pode ter colocado em risco a vida de um promotor. Ela teme que Pedro possa ser o alvo de Zeca por suas investigações ao lado de Flora, mas tenta seguir o dia mergulhada na defesa de Dinorah, enquanto Hugo desperta a curiosidade sobre sua mãe biológica.","air_date":"2022-04-15","runtime":41,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"4":{"name":"Perdão Pelo Silêncio","overview":"Heloísa é tomada pela culpa da morte causada pelo \"salve\", enquanto o crime de sua infância fica cada vez mais claro em sua memória. A força-tarefa descobre que a vítima de Dinorah está ligada a Zeca e pede que Heloísa deixe o caso.","air_date":"2022-04-15","runtime":32,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"5":{"name":"Você Não Tinha Esse Direito","overview":"Com as memórias de seu passado finalmente claras, Heloísa confronta a própria família e se joga nas novas pistas do caso de Dinorah, mas nada sai como esperado.","air_date":"2022-04-15","runtime":36,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0},"6":{"name":"A Sentença Não Pode Ser Proferida","overview":"Isolada da família, Heloísa enfrenta sozinha o complexo julgamento de Dinorah e a sentença vem acompanhada de uma nova ameaça para a advogada.","air_date":"2022-04-15","runtime":48,"still_path":"https://image.tmdb.org/t/p/originalnull","vote_average":0}}}}},
