"201076":{"id":"201076","name":"Criminosos","slug":"criminosos","original_title":"Culprits","overview":"Joe Petrus vive com seu noivo e dois enteados. Mas eles não sabem que, há três anos, Joe se envolveu em um crime. Quando um assassino começa a matar os ex-integrantes da gangue, Joe percebe que sua família está em perigo e vai a Londres para encontrar os comparsas e descobrir quem está atrás deles.","first_air_date":"2023-11-08","episode_run_time":55,"vote_average":6,"number_of_seasons":1,"number_of_episodes":8,"created_by":["J Blakeson"],"production_companies":["Character 7"],"genres":["Crime","Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/oAYocRuZil32uu1aZwdpubWuJV1.jpg","poster_path":"https://image.tmdb.org/t/p/original/qbtet97EtBaCwhw5gab1hokoQNJ.jpg","cast":["Nathan Stewart-Jarrett","Gemma Arterton","Eddie Izzard","Kirby Howell-Baptiste","Niamh Algar"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/qbtet97EtBaCwhw5gab1hokoQNJ.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/qbtet97EtBaCwhw5gab1hokoQNJ.jpg","air_date":"2023-11-08","episode_count":8,"overview":"N/A","vote_average":10,"episodes":{"1":{"name":"Mudança de Uso","overview":"Joe está vivendo a vida dos sonhos, mas tem um segredo do passado que está prestes a vir à tona.","air_date":"2023-11-08","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/mGzyJcCRWe7iUY6YEtDyUyJiqyS.jpg","vote_average":10},"2":{"name":"Tamboril","overview":"As mentiras de Joe complicam seu presente, e um flashback revela um surpreendente membro da gangue.","air_date":"2023-11-08","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/7cIktT2h90V7REyew0gKOKQ0shr.jpg","vote_average":10},"3":{"name":"Pflegedienstleitung","overview":"A Especialista recebe uma visita surpresa e Joe embarca numa missão para neutralizar uma ameaça.","air_date":"2023-11-08","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/kUlCJdbTGidSYfzdxctaq0zpOtM.jpg","vote_average":10},"4":{"name":"Círculos em um Círculo","overview":"Após um reencontro tenso, Joe e Oficial vão para a França em busca do assassino.","air_date":"2023-11-08","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/7gS5BHbXKa4bCtsEchQplnDCWyK.jpg","vote_average":10},"5":{"name":"Vamos Falar Sério","overview":"O assassino fecha o cerco e seu motivo se torna evidente. Mas quem é o mandante?","air_date":"2023-11-08","runtime":48,"still_path":"https://image.tmdb.org/t/p/original/i7lamwtUfUAGFX53LhMva9WuKFz.jpg","vote_average":10},"6":{"name":"Receptáculos","overview":"A gangue descobre algo surpreendente, e a armadilha feita para o assassino dá errado.","air_date":"2023-11-08","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/bzI9b3DJ2Ph5HzPXqa4kLSh6CPj.jpg","vote_average":10},"7":{"name":"Nossa Saída","overview":"A gangue se vê em menor número, e Joe precisa tomar uma decisão impossível.","air_date":"2023-11-08","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/egRbsLuVKTQGyM39fgFVATG0jGb.jpg","vote_average":10},"8":{"name":"A Floresta","overview":"Joe tenta criar uma armadilha para Dianne, e a vida da sua família fica em risco.","air_date":"2023-11-08","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/9Nt5npLvUpQhBTxgAn3HxrxnGJ1.jpg","vote_average":10}}}}},
