"127447":{"id":"127447","name":"Ringo. Glória e Morte","slug":"ringo-gloria-e-morte","original_title":"Ringo, gloria y muerte","overview":"Em busca de uma retomada na carreira do boxe, já em declínio devido a uma série de infelizes contratos, \"Ringo\" Bonavena, o boxeador peso-pesado mais lembrado da Argentina, chega à Nevada em 1976. Ele se envolve com a máfia do jogo liderada por Joe Conforte. Ringo vive os últimos três meses de vida na esperança de conseguir uma luta final com Ali, mas é assassinado em circunstâncias pouco claras.","first_air_date":"2023-03-24","episode_run_time":0,"vote_average":7.4,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Nicolás Pérez Veiga"],"production_companies":["Pampa Films","Gloriamundi Producciones","EO MEDIA","Story Lab","Primo Content","Star Original Productions"],"genres":["Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/qGfygSzVY0ygxTc7ldBMzSRPaTn.jpg","poster_path":"https://image.tmdb.org/t/p/original/hiYl3F7R67qh2bIHsoinTKX5lze.jpg","cast":["Jerónimo Bosia","Delfina Chaves","María Onetto","Martín Slipak","Renato Quattordio"],"trailer":"jBTE4Q9JxJA","seasons":{"1":{"name":"Season 1","poster_path":"https://image.tmdb.org/t/p/original/hiYl3F7R67qh2bIHsoinTKX5lze.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/hiYl3F7R67qh2bIHsoinTKX5lze.jpg","air_date":"2023-03-24","episode_count":7,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Quem Nada Sabe, Nada Questiona","overview":"1976. Com sua carreira esportiva em declínio, Ringo Bonavena chega a Reno, Nevada, em busca de vingança contra Muhammad Ali. Lá, ele recebe Joe Conforte, que comprou seu contrato, junto com sua esposa Sally e seu tutor, Willard Ross Brymer. Em 1963, o jovem argentino peso-pesado Oscar Bonavena é suspenso após uma briga escandalosa nos Jogos Pan-Americanos de São Paulo.","air_date":"2023-03-24","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/mPOiw1d5zBqc2zIcPZL7BG0GCQ2.jpg","vote_average":0},"2":{"name":"Campeão com os Pés Planos","overview":"1965. Após a morte do pai, Ringo volta à Argentina com um plano ambicioso: ser o campeão argentino dos pesos-pesados. Depois de uma grande estreia na volta a Buenos Aires, ele conhece Tito Lectoure. Em Reno, Vinnie Lorenzo, chefe de segurança do prostíbulo Mustang, tem más notícias.","air_date":"2023-03-24","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/38CHyuUW8mFx3c5Np7KPvtwN8x5.jpg","vote_average":0},"3":{"name":"É Dia de Caça","overview":"Depois de se tornar campeão argentino dos pesos-pesados, Ringo se distancia de Dora e de seu círculo próximo, afastando-se do ringue e tornando-se uma estrela da mídia. Além disso, Ringo, Brymer e Vinnie decidem ir caçar nas montanhas.","air_date":"2023-03-24","runtime":30,"still_path":"https://image.tmdb.org/t/p/original/1MihvPL1n4hz2xf2hIDqUjE2mB.jpg","vote_average":0},"4":{"name":"100 Dólares por Meia Hora","overview":"1967. Ringo viaja à Alemanha para uma luta preliminar pelo título mundial que Muhammad Ali deixou vago por se recusar a ir ao Vietnã. Em Reno, depois de uma noite descontraída nas montanhas, a relação entre Ringo, Tracy e Suarez se fortalece.","air_date":"2023-03-24","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/nvHUxkz9NisUDlqt1cvXhoCYpcE.jpg","vote_average":0},"5":{"name":"Grana, Grana, Grana","overview":"1968. Apesar de ter sido derrotado por Jimmy Ellis nas semifinais mundiais, Ringo tem a chance de enfrentar Joe Frazier. Demitindo Tito Lectoure, Ringo embarca em uma luta perigosa na Filadélfia.","air_date":"2023-03-24","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/uJdgnJJG4ZqpK0GG6l5a1hky6Et.jpg","vote_average":0},"6":{"name":"O Amigo Caribenho","overview":"Ao voltar de Lake Tahoe, e depois de assumir uma festa no Mustang Ranch, Ringo e Suarez recebem uma forte ameaça de Joe Conforte.","air_date":"2023-03-24","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/q0wWJTiiEtz8CoF5Z67tsimgLIb.jpg","vote_average":0},"7":{"name":"Covarde","overview":"Nova York 1970. A luta do século é iminente. Ringo e Muhammad Ali, cara a cara. Em Reno, Ringo recebe uma ligação inesperada e foge para o Mustang Ranch, onde encontra seu trágico destino.","air_date":"2023-03-24","runtime":35,"still_path":"https://image.tmdb.org/t/p/original/6SqV3IvWjSu8mEjidlD5vYHpERw.jpg","vote_average":0}}}}},
